import React from "react";
import Slider from "react-slick";


const Testimonials = () => {
  return (
    <Slider>
        <div className="testimonial py-4 px-3">
            <p>
                Lorem ipsum dolor, sit amet consectetur adipisicing elit. Ad quibusdam dolor dicta eos expedita numquam quasi rem exercitationem ducimus eum minus rerum, quis qui amet provident aperiam, atque, a vitae!
            </p>
        </div>
    </Slider>
  )
};

export default Testimonials;
